function [k,f] = fcn(point,breakPoints)
if(point >= breakPoints)
    k = length(breakPoints);
    f = 0;
    return
elseif(point <= breakPoints)
    k = 1;
    f = 0;
else
    endIndex = length(breakPoints);
    for i = 1:length(breakPoints)
        if(point <= breakPoints(i))
            endIndex = i;
        break
        end
    end
    k = endIndex - 1;
    f = (point - breakPoints(k))/(breakPoints(endIndex) - breakPoints(k));
end

function y = fcn(k,f,T)
if(f == 0)
    y = T(k);
else
    diff = T(k+1) - T(k);
    y = T(k) + f*diff;
end

